import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

import QuantitySelector from './App';
function App() {
  return (
    <div className="App">
      <QuantitySelector />
    </div>
  );
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <QuantitySelector />
  </React.StrictMode>

);
